/* Procedure structure for procedure `DBase_Capacity_Stats` */

/*!50003 DROP PROCEDURE IF EXISTS  `DBase_Capacity_Stats` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`e569777`@`%` PROCEDURE `DBase_Capacity_Stats`()
BEGIN
  SELECT
    variable_value INTO @local_hostname
  FROM
    information_schema.global_variables
  WHERE variable_name = 'hostname';
    DateCreated,
    ServerInfo,
    DBName,
    DBSizeMB,
    DBTableCount,
    DBMS
  )
  SELECT
    NOW(),
    @local_hostname,
    TABLE_SCHEMA 'DBName',
    ROUND(
      SUM(data_length + index_length) / 1024 / 1024,
      1
    ) 'DBSizeMB',
    COUNT(*),
    VERSION()
  FROM
    information_schema.tables
  GROUP BY table_schema;
  UPDATE
    Stats_Capacity
  SET
    Environment_Detail = 'DEV'
  WHERE DBName LIKE '%DEV%';
  UPDATE
    Stats_Capacity
  SET
    Environment_Detail = 'PPE'
  WHERE DBName LIKE '%PPE%';
  UPDATE
    Stats_Capacity
  SET
    Environment_Detail = 'PRF'
  WHERE DBName LIKE '%PRF%';
  UPDATE
    Stats_Capacity
  SET
    Environment_Detail = 'TST'
  WHERE DBName LIKE '%TST%';
  UPDATE
    Stats_Capacity
  SET
    Environment_Detail = 'ACC'
  WHERE DBName LIKE '%ACC%';
  UPDATE
    Stats_Capacity
  SET
    Environment_Detail = 'INT'
  WHERE DBName LIKE '%INT%';
  UPDATE
    Stats_Capacity
  SET
    Environment = 'Non-PRD'
  WHERE DBName LIKE '%PPE%'
    OR DBName LIKE '%DEV%'
    OR DBName LIKE '%PRF%'
    OR DBName LIKE '%TST%'
    OR DBName LIKE '%ACC%'
    OR DBName LIKE '%INT%';
  UPDATE
    Stats_Capacity
  SET
    Environment_Detail = 'System',
    Environment = 'System'
  WHERE DBName LIKE '%GTIDBA%'
    OR DBName LIKE '%schema%'
    OR DBName LIKE '%sql%';
  UPDATE
    Stats_Capacity
  SET
    HighAvailability = 'NO'
  WHERE DBMS LIKE '%Maria%';
  UPDATE
    Stats_Capacity
  SET
    HighAvailability = 'YES'
  WHERE DBMS LIKE '%enterprise%';
  UPDATE
    Stats_Capacity AS A
    INNER JOIN Static_Data AS B
      ON A.DBName = B.DBName SET A.OrgLevel1 = B.OrgLevel1,
    A.OrgLevel2 = B.OrgLevel2,
    A.OrgLevel3 = B.OrgLevel3,
    A.FuncDomain = B.FuncDomain,
    A.Application = B.Application;
END */$$
DELIMITER ;

